public int hashCode() {
  final int prime = 31;
  int result = 1;
  result = prime * result + ((block == null) ? 0 : block.hashCode());
  result = prime * result
      + ((storageType == null) ? 0 : storageType.hashCode());
  result = prime * result
      + ((storageUuid == null) ? 0 : storageUuid.hashCode());
  return result;
}
